        function decodeBase64(encoded, dtype) {

    let getter = {
        "float32": "getFloat32",
        "int32": "getInt32"
    }[dtype];

    let arrayType = {
        "float32": Float32Array,
        "int32": Int32Array
    }[dtype];

    let raw = atob(encoded);
    let buffer = new ArrayBuffer(raw.length);
    let asIntArray = new Uint8Array(buffer);
    for (let i = 0; i !== raw.length; i++) {
        asIntArray[i] = raw.charCodeAt(i);
    }

    let view = new DataView(buffer);
    let decoded = new arrayType(
        raw.length / arrayType.BYTES_PER_ELEMENT);
    for (let i = 0, off = 0; i !== decoded.length;
        i++, off += arrayType.BYTES_PER_ELEMENT) {
        decoded[i] = view[getter](off, true);
    }
    return decoded;
}

                    center: {x: 0, y: 0, z: 0}},
    };

    return cameras[view];

}

function getLayout(plotDivId, viewSelectId, blackBg) {

    let camera = getCamera(plotDivId, viewSelectId);
    let axisConfig = getAxisConfig();

    let height = Math.min($(window).outerHeight() * .9,
                            $(window).width() * 2 / 3);
    let width = height * 3 / 2;

    let layout = {
        height: height, width: width,
        margin: {l:0, r:0, b:0, t:0, pad:0},
        hovermode: false,
        paper_bgcolor: blackBg ? '#000': '#fff',
        axis_bgcolor: '#333',
        scene: {
            camera: camera,
            xaxis: axisConfig,
            yaxis: axisConfig,
            zaxis: axisConfig
        }
    };

    return layout;

}

function updateLayout(plotDivId, viewSelectId, blackBg) {
    let layout = getLayout(
        plotDivId, viewSelectId, blackBg);
    Plotly.relayout(plotDivId, layout);
}

function textColor(black_bg){
    if (black_bg){
        return "white";
    }
    return "black";
}

function addColorbar(colorscale, cmin, cmax, divId, layout, config,
                     fontsize=25, height=.5, color="black") {
    // hack to get a colorbar
    let dummy = {
        "opacity": 0,
        "colorbar": {"tickfont": {"size": fontsize, "color": color},
                     "len": height},
        "type": "mesh3d",
        "colorscale": colorscale,
        "x": [1, 0, 0],
        "y": [0, 1, 0],
        "z": [0, 0, 1],
        "i": [0],
        "j": [1],
        "k": [2],
        "intensity": [0.],
        "cmin": cmin,
        "cmax": cmax,
    };

    Plotly.plot(divId, [dummy], layout, config);

}


function decodeHemisphere(surfaceInfo, surface, hemisphere){

    let info = surfaceInfo[surface + "_" + hemisphere];

    for (let attribute of ["x", "y", "z"]) {
        if (!(attribute in info)) {
            info[attribute] = decodeBase64(
                info["_" + attribute], "float32");
        }
    }

    for (let attribute of ["i", "j", "k"]) {
        if (!(attribute in info)) {
            info[attribute] = decodeBase64(
                info["_" + attribute], "int32");
        }
    }

}

        function makePlot(surface, hemisphere, divId) {

            decodeHemisphere(surfaceMapInfo, surface, hemisphere);
            info = surfaceMapInfo[surface + "_" + hemisphere];
            info["type"] = "mesh3d";
            info["vertexcolor"] = surfaceMapInfo["vertexcolor_" + hemisphere];

            let data = [info];

            info['lighting'] = getLighting();
            let layout = getLayout("surface-plot", "select-view",
                                   surfaceMapInfo["black_bg"]);
            layout['title'] = {
                text: surfaceMapInfo['title'],
                font: {size: surfaceMapInfo["title_fontsize"],
                       color: textColor(surfaceMapInfo["black_bg"])},
                yref: 'paper',
                y: .95};
            let config = getConfig();

            Plotly.react(divId, data, layout, config);

            if(surfaceMapInfo["colorbar"]){
                addColorbar(surfaceMapInfo["colorscale"],
                            surfaceMapInfo["cmin"],
                            surfaceMapInfo["cmax"],
                            divId, layout, config,
                            surfaceMapInfo["cbar_fontsize"],
                            surfaceMapInfo["cbar_height"],
                            color=textColor(surfaceMapInfo["black_bg"]));
            }
        }

        function addPlot() {

            let hemisphere = $("#select-hemisphere").val();
            let kind = $("#select-kind").val();
            makePlot(kind, hemisphere, "surface-plot");
        }

        function surfaceRelayout(){
            return updateLayout("surface-plot", "select-view",
                                surfaceMapInfo["black_bg"]);
        }

    <script>
        $(document).ready(

                addPlot();
                $("#select-view").change(surfaceRelayout);
                $("#surface-plot").mouseup(function() {

                $(window).resize(surfaceRelayout);

            });
